A classic problem in type systems!

In TypeScript, you can use various techniques to convey to the type system that you know a value will only have one specific type in practice, despite being assignable to multiple types in theory. Here are a few approaches:

1. **Type Guards**:
Create a function that returns a type predicate (a function returning a boolean and a type) using the `is` keyword. This function can be used to narrow the type of a value within a specific scope.
```typescript
function isStringOrNumber(value: unknown): value is string | number {
  return typeof value === 'string' || typeof value === 'number';
}

function processValue(value: unknown) {
  if (isStringOrNumber(value)) {
    // Now 'value' is known to be string | number (narrowed type)
    console.log(value.toFixed()); // OK
  } else {
    // Handle the case where 'value' is not string | number
  }
}
```
2. **Type Assertions**:
Use a type assertion (`as`) to tell TypeScript that you're sure about the type, despite the value being assignable to multiple types.
```typescript
function processValue(value: unknown) {
  const stringValue = value as string | number;
  console.log(stringValue.toFixed()); // TypeScript won't warn, but be careful!
}
```
**Note:** Type assertions should be used judiciously, as they can lead to runtime errors if the assumption is incorrect.

3. **User-Defined Type Guards with a single type**:
Create a type alias or a type helper that represents the specific type you know the value will have. Then, use a type guard function to narrow the type to that single type.
```typescript
type SingleKnownType = string;

function isSingleKnownType(value: unknown): value is SingleKnownType {
  return typeof value === 'string';
}

function processValue(value: unknown) {
  if (isSingleKnownType(value)) {
    // Now 'value' is known to be SingleKnownType (string)
    console.log(value.toUpperCase()); // OK
  } else {
    // Handle the case where 'value' is not SingleKnownType
  }
}
```
4. **Enum-like types with a single variant**:
If you're working with a limited set of values, consider using an enum with a single variant. This can help convey your intention to the type system.
```typescript
