```java
class Solution {
    public boolean isPowerOfThree(int n) {
        if (n < 1) return false;
        int max = 1162261467; // 3^19
        return n == 1 || n % 3 == 0 && n % (3 * 3) == 0 && max % n == 0;
    }
}
```

The idea is to recognize that `3^19` is the largest power of 3 that fits within the given range `-231 to 231 - 1`. We can check if `n` is a power of 3 by checking if it's divisible by 3 and also divisible by `(3 * 3)` (i.e., `9`), and also checking if `max` (the largest power of 3) is divisible by `n`. We also handle the edge case where `n` is 1 separately.

