def fibonacci(n):
    if n <= 0:
        return "Input should be positive integer."
    elif n == 1:
        return 0
    elif n == 2:
        return 1
    else:
        fib_values = [0, 1]  # base cases
        while len(fib_values) < n:
            fib_values.append(fib_values[len(fib_values)-1] + fib_values[len(fib_values)-2])
        return fib_values[-1]

